import Header from "./components/header";
import Sidebar from "./components/Sidebar";
import MainContent from "./components/MainContent";
import PopularPosts from "./components/PopularPosts";

function App() {
  return (
    <div className="app">
      <Header />
      <PopularPosts />
      <div className="content">
        <Sidebar />
        <MainContent />
      </div>
    </div>
  );
}
export default App;
